import React, { useState, useEffect } from "react";
import axios from "axios";
import "./App.css";

const API_URL = "http://localhost:8090"; // 백엔드 서버 주소

const App = () => {
  const [orderInfo, setOrderInfo] = useState({
    deliveryAddress: "",
    recipient: "",
    deliveryInstruction: "",
    paymentMethodId: "",
  });
  const [products, setProducts] = useState([]);
  const [paymentResult, setPaymentResult] = useState("");

  useEffect(() => {
    const fetchProducts = async () => {
      try {
        const response = await axios.get(`${API_URL}/products`);
        setProducts(
          response.data.map((product) => ({
            ...product,
            quantity: 1, // 초기 수량 설정
          }))
        );
      } catch (error) {
        console.error("Error fetching products:", error);
      }
    };

    fetchProducts();
  }, []);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setOrderInfo((prev) => ({ ...prev, [name]: value }));
  };

  const handleQuantityChange = (index, quantity) => {
    const updatedProducts = [...products];
    updatedProducts[index].quantity = quantity;
    setProducts(updatedProducts);
  };

  const submitOrder = async () => {
    try {
      const response = await axios.post(`${API_URL}/orders`, {
        ...orderInfo,
        products: products.map((product) => ({
          productId: product.id,
          quantity: product.quantity,
        })),
      });

      if (response.status === 200) {
        setPaymentResult("Order processed successfully.");
      } else {
        setPaymentResult("An error occurred during order processing.");
      }
    } catch (error) {
      console.error("Error submitting order:", error);
      setPaymentResult("An error occurred during order processing.");
    }
  };

  return (
    <div className="app">
      <div className="order-payment">
        {/* Order and payment form */}
        {/* Simplified for brevity */}
      </div>

      <div className="order-details">
        <h3>Products</h3>
        {products.map((product, index) => (
          <div key={product.id} className="product">
            <div>{product.name}</div>
            <div>${product.price}</div>
            <input
              type="number"
              value={product.quantity}
              onChange={(e) =>
                handleQuantityChange(index, parseInt(e.target.value))
              }
              min="1"
            />
          </div>
        ))}
      </div>

      <div className="payment-button">
        <button onClick={submitOrder}>Submit Order</button>
      </div>

      {paymentResult && <div>{paymentResult}</div>}
    </div>
  );
};

export default App;
